const Footer = () => {
    return (
        <footer className="w-full absolute bottom-0 bg-gray-200 flex flex-col items-center">
    <div className="relative w-full h-40 flex justify-center items-center">
        {/* Angled Lines */}
        {Array.from({ length: 11 }).map((_, index) => {
            const angle = (index - 5) * -10; // Adjust angle (-50 to +50 degrees)
            const offsetX = (index - 5) * 10; // Space out the lines
            return (
                <div
                    key={`angled-${index}`}
                    className="w-1 h-40 bg-black absolute"
                    style={{
                        transform: `rotate(${angle}deg)`,
                        transformOrigin: "bottom center",
                        left: `calc(50% + ${offsetX}px)`, // Position each line spaced out from the center
                    }}
                ></div>
            );
        })}

        {/* Horizontal Lines */}
        {Array.from({ length: 5 }).map((_, index) => (
            <div
                key={`horizontal-${index}`}
                className="w-full h-[2px] bg-black absolute"
                style={{
                    top: `${10 + index * 25}px`, // Adjust spacing between lines
                }}
            ></div>
        ))}
    </div>
</footer>


    );
};

export default Footer;
